document.addEventListener("DOMContentLoaded", function() {
  const fakeButton = document.getElementById('fake');

  function moveButton() {
    const x = Math.random() * (window.innerWidth - fakeButton.clientWidth);
    const y = Math.random() * (window.innerHeight - fakeButton.clientHeight);
    fakeButton.style.position = 'absolute';
    fakeButton.style.left = `${x}px`;
    fakeButton.style.top = `${y}px`;
  }

  
  fakeButton.addEventListener('mouseover', moveButton);
});

const imgData = 'data:image/webp;base64,';


function formatDate(day) {
  const options = { year: 'numeric', month: 'long', day: 'numeric' };
  return new Date(day + 'T00:00:00').toLocaleDateString('es-ES', options);
}


function createTicket() {
  const day = document.getElementById('selected-date').value;
  const museum = document.getElementById('museumName').textContent; 

  if (day && museum) {
    const formattedDate = formatDate(day); 
    document.getElementById('name').textContent = museum;
    document.getElementById('day').textContent = `Día de la visita: ${formattedDate}`;
    document.getElementById('ticket').style.display = 'block';
  } else {
    document.getElementById('ticket').style.display = 'none';
  }
}

// Genmerate ticket
function generatePDF() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  const museum = document.getElementById('museumName').textContent; 
  const day = document.getElementById('day').textContent; 

  // Add image
  doc.addImage(imgData, 'JPEG', 15, 15, 180, 80);

  // Add text
  doc.setFontSize(20);
  doc.text(20, 110, museum);

  doc.setFontSize(12);
  doc.text(20, 130, day);

  doc.setFontSize(12);
  doc.text(20, 150, 'Tengo muchas ganas de pasar tiempo contigo y conocerte un poco mejor en este lugar tan especial.');
  doc.text(20, 170, 'Estoy deseando que llegue ese momento.');

  doc.save('ticket.pdf');
}

